import React from 'react';
import { Link } from 'react-router-dom';

const ReportsHome = () => {
  return (
    <div>
      <h1>Reports Dashboard</h1>
      <nav>
        <ul>
          <li>
            <Link to="/reports/frequency">Frequency Report</Link>
          </li>
          <li>
            <Link to="/reports/effectiveness">Effectiveness Report</Link>
          </li>
          <li>
            <Link to="/reports/overdue">Overdue Trends</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default ReportsHome;
